1609263432_3372:"Notice: 127.0.0.1; Sl-insta-media status has been changed; details: ID: 1280,Old status: new,New status: publish,Title: Il digiuno a staffetta in dialogo con le istituzioni contro i passi indietro sulla #cannabis e\u0300 stato promosso da @fuoriluogoit ed e\u0300 stato aperto il 23 ottobre da @marcocappato , tesoriere dell&#039; @associazione_luca_coscioni .&quot;Le carceri scoppiano. Liberiamo la cannabis&quot;. Con questo motto sono stato questa mattina davanti a Montecitorio, per chiedere al Parlamento e nello specifico al Presidente della Commissione Giustizia Mario Perantoni, di riprendere il dibattito sulla cannabis che in 8 mesi ha visto impegnato il Parlamento per sole 4 ore di audizioni degli esperti.Cio\u0300 avviene in uno scenario sanitario di crisi, con istituti carcerari sovraffollati e in cui il distanziamento sociale non e\u0300 possibile (come abbiamo potuto vedere a marzo), mettendo a rischio persone detenute, polizia penitenziaria e operatori. E tutto questo a causa di un solo articolo di una sola legge: il 29,6% degli ingressi in carcere avviene oggi per l&#039;articolo 73 del Testo Unico Stupefacenti. Come possiamo leggere dall&#039;XI Libro Bianco sulle Droghe, l&#039;unico strumento a nostra disposizione per leggere la realta\u0300 delle sostanze in Italia, al 31 dicembre 2019 il 34,8% delle persone detenute nelle carceri italiane lo erano per la violazione degli articoli 73 e 74 del DPR 309\/90, confronto a una media europea del 18% e mondiale del 20%.Regolamentare un mercato come quello degli stupefacenti, in particolare della cannabis, darebbe respiro alle nostre carceri, alla nostra economia e avrebbe il pregio di sostituire alla repressione fine a se\u0301 stessa la tutela della salute.#cannabismedicine #cannabissativa #cannabiscommunity #lecarceri #legalizzazione #cannabisculture #cannabiscommunity420 #cannabisdaily #carceri #cannabis #cannabissociety #cannabisphotography #cannabisindustry #cannabis420 #parlamento #cannabiscomunity #cannabisnews #cannabispics #manifestazione #cannabisnow #cannabislegal #parlamentoitalianoBy @matteo.mainardi \ud83d\ude03\ud83d\ude04\ud83c\udf32\ud83c\udf31"
