1609272044_3326:"Notice: 127.0.0.1; Sl-insta-media status has been changed; details: ID: 1301,Old status: new,New status: publish,Title: Did you know that cannabis roots can be harvested and used medicinally too? I didn\u2019t. It\u2019s not surprising though, cannabis has so much medicine to give. Thankfully I found out about the roots right before I harvested my last plant..The first record of using the roots medicinally was found in an ancient Chinese book of herbal medicine written around 2700 BCE. The roots have a higher concentration of two specific terpenes (friedelin and epifriedelanol) than anywhere else in the plant. Those terps are known to be helpful for pain and inflammation. The roots haven\u2019t been studied nearly enough but in one small study they even made cancer cells self-destruct!.Other uses:* liver support* just about any skin issue, used topically* joint pain* fever* infection* to stop bleeding.Most often roots are either boiled or dehydrated, depending on desired use. My plan is to dehydrate these roots. I\u2019ll set aside some for tea that I\u2019ll drink during painful periods, and I\u2019ll grind some up into powder to make into a topical paste to have on hand for skin issues (I\u2019ll store it as powder, when needed I\u2019ll put some of the powder into a small bowl and mix with a tiny bit of water). I think I\u2019ll make a tincture with the next batch..Yay for new learning! The homestead apothecary expands again \ud83d\udc9a.....#removethestigma #herbalmedicine #womenwhogrow #cannabiscommunity #cannabismedicine #cannabisheals #plantallies #herbalism #herbalapothecary #organicaf #getgrowin #homesteadlife #chronicpainwarrior #organiccannabis #modernhomestead #victorygarden #urbanhomestead #permaculture #giy #cannabismedicinal #growyourownmedicine #modernhomestead #plantmedicine #naturalhealing #urbanorganicgardener #growfoodnotlawns #growingcannabis #plantmagic #organicallygrowingcannabisBy @organicallygrowing \ud83d\ude03\ud83d\ude04\ud83c\udf32\ud83c\udf31"
